        <meta charset="utf-8">

        <title>Untitled</title>
        <style>
            body {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                margin: 0;
                padding: 0;
                overflow: hidden;
            }

            svg {
                display: none;
                filter: blur(0);
            }

            .sozi-frame-list {
                position: absolute;
                top: 0;
                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;
                padding: 0.5em 1em 0.5em 0.25em;
                overflow-y: auto;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-frame-list ol {
                margin: 0;
                overflow-x: hidden;
            }

            .sozi-frame-list li {
                white-space: nowrap;
            }

            li.sozi-title-level-1:before { content: '. . ';             color: rgb(100, 100, 100); }
            li.sozi-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }
            li.sozi-title-level-3:before { content: '. . . . . . ';     color: rgb(100, 100, 100); }
            li.sozi-title-level-4:before { content: '. . . . . . . . '; color: rgb(100, 100, 100); }

            .sozi-frame-list a {
                color: inherit;
                text-decoration: none;
            }

            .sozi-frame-list a:hover {
                color: rgb(0, 204, 255);
                text-decoration: underline;
            }

            .sozi-frame-list a.current {
                color: rgb(255, 170, 68);
            }

            .sozi-frame-number {
                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                cursor: pointer;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;
                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }
            }

            .spinner:before {
                content: '';
                box-sizing: border-box;
                position: absolute;
                top: 50%;
                left: 50%;
                width: 40px;
                height: 40px;
                margin-top: -20px;
                margin-left: -20px;
                border-radius: 50%;
                border: 4px solid #ccc;
                border-top-color: #333;
                animation: spinner .8s linear infinite;
            }
        </style>
    </head>

    <g id="g14996" ns324:jacobian_sqrt="0.323077" ns324:inkscapeversion="1.0" ns324:alignment="middle center" ns324:scale="0.9158079013263463" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:text="\\begin{minipage}{12cm}\nO Teorema de Stevin, ou Lei de Stevin \xe9 um princ\xedpio f\xedsico, estabelecido pelo matem\xe1tico, engenheiro, e f\xedsico Simon Stevin, que estabelece que a press\xe3o absoluta num ponto de um l\xedquido homog\xeaneo e incompress\xedvel, de densidade $\\rho$  e \xe0 profundidade $h$, \xe9 igual \xe0 press\xe3o atmosf\xe9rica (exercida sobre a superf\xedcie desse l\xedquido) mais a press\xe3o efetiva, e n\xe3o depende da forma do recipiente:\n\\begin{equation*}\np_{\\text{abs}}=p_{\\text{atm}}+p_{\\text{ef}},\n\\end{equation*}\nou ainda\n\\begin{equation}\np_{\\text{abs}}=p_{\\text{atm}}+\\rho g h,\n\\end{equation}\nonde $g$ \xe9 o valor da acelera\xe7\xe3o da gravidade local.\n\\end{minipage}" ns324:pdfconverter="inkscape" ns324:texconverter="pdflatex" ns324:version="1.1.0" transform="matrix(0.32307699,0,0,0.32307699,309.73289,214.4938)">

    <g id="g49339" ns324:jacobian_sqrt="0.323077" ns324:inkscapeversion="1.0" ns324:alignment="middle center" ns324:scale="0.9158079013263463" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:text="\\begin{minipage}{10cm}\nQuando dois l\xedquidos que n\xe3o se misturam, imisc\xedveis, s\xe3o colocados num mesmo recipiente, eles disp\xf5em-se de modo que o l\xedquido de maior densidade ocupe a parte de baixo, e o de menor densidade ocupe a parte de cima. A separa\xe7\xe3o entre eles \xe9 horizontal. Por exemplo, \xe1gua e \xf3leo, se forem colocados no mesmo recipiente, o \xf3leo, menos denso, ficar\xe1 na parte de cima, e a \xe1gua, mais densa, permanecer\xe1 na parte inferior. Nos vasos comunicantes, eles distribuem-se de forma que as alturas das colunas l\xedquidas sejam inversamente proporcionais \xe0s respectivas densidades.\n\nPartindo-se do princ\xedpio de que o sistema est\xe1 em equil\xedbrio, podemos igualar as press\xf5es nos pontos A e B\n\n\\begin{equation*}\np_{\\text{A}}=p_{\\text{B}},\n\\end{equation*}\n\\begin{equation*}\np_{\\text{atm}}+\\rho_{\\text{A}} g h_{\\text{A}}=p_{\\text{atm}}+\\rho_{\\text{B}} g h_{\\text{B}},\n\\end{equation*}\n\\begin{equation} \\tag{2}\n\\frac{h_{\\text{A}}}{h_{\\text{B}}}=\\frac{\\rho_{\\text{B}}}{\\rho_{\\text{A}}}.\n\\end{equation}\n\n\\end{minipage}" ns324:pdfconverter="inkscape" ns324:texconverter="pdflatex" ns324:version="1.1.0" transform="matrix(0.32307699,0,0,0.32307699,530.88897,196.47043)">
